import React from "react";

class DetailFavorite extends React.Component {
    constructor(props) {
        super(props);
        let checking = props.id.substr(4, 4) !== 'http';
        this.state = {
            error: null,
            isLoaded: false,
            data: props.data
        };
    }

    render() {

    }
}

export default DetailFavorite;
